import React, { Component } from 'react'

import { ProjectContainer, ProjectImage, ProjectOverlay } from './Project.styles'

class Project extends Component {
  state = { hovered: false }

  mouseOver = () => this.setState({ hovering: true })
  mouseOut = () => this.setState({ hovering: false })

  render() {
    if (this.props.name === 'tenners') {
      return (
        <ProjectContainer
          onMouseOver={this.mouseOver}
          onMouseOut={this.mouseOut}
        >
          <ProjectImage src="https://res.cloudinary.com/fsuffieldcode/image/upload/v1584229261/tenners-responsive-mockup.jpg" />
        </ProjectContainer>
      )
    }
  }
}

export default Project
